import React , { Component }from 'react';
import './App.css';
import Map from './Components/Map'
class App extends Component {

  constructor(props){

    super(props);
    this.state = {
      pointer:{lat:'30.741482',long:'72.877426'}
    }

  }

  render(){
    return(
      <div className="App">
       <Map pointer={this.state.pointer}/>
      </div>
    )
    }

}

export default App;
